import React from 'react';
import './Conf.css'

let Conf = (props) => {

    return (
    <div className='Conf'>
            <div> 
                <p className='Conf__text'>You sell {props.sellValue} {props.sell}  and buy {props.buyValue} {props.buy}.</p>
                <p className='Conf__text'>To exchange send us {props.sellValue} {props.sell}  to {props.wall}</p>
                <p className='Conf__text'>You will recive {props.buyValue} {props.buy} to {props.ActiveWall}</p>
            </div>
    </div>)}

export default Conf
